class Solution(object):
    def countPalindromicSubsequence(self, s):
        """
        :type s: str
        :rtype: int
        """
        palindromic = []
        sn = set(s)
        for char1 in sn:
            i = s.find(char1)
            for char2 in set(s[i+1:]):
                ii = s.find(char2, i+1)
                if s[i] in s[ii+1:]:
                    palindromic.append((s[i] + s[ii] + s[i]))
        return len(set(palindromic))


if __name__ == '__main__':
    print('in main')
    s = ""
    print(Solution().countPalindromicSubsequence(s))
